import React, { Component } from 'react';
import Todos from './components/Todos';
import './App.css';

class App extends Component {
  state  = {
    todos: [
      {
        id: 1, 
        title: "Make my Resume",
        isCompleted: false,
      },
      {
        id: 2, 
        title: "Go to the gym",
        isCompleted: false,
      },
      {
        id: 3, 
        title: "Have dinner with friends",
        isCompleted: false,
      }, 
      {
        id: 4, 
        title: "Cooking with friends",
        isCompleted: false,
      }
    ],
  }
  render() {
    return (
      <div className="App">
        <h3>Wow</h3>
        <Todos/>
      </div>
    );
  }
}

export default App;
